function WordByLetter({ word }) {
    return (
        <ul className="word">
            {word.map((letter, index) => {
                return (
                    <li key={index} className="word-by-letter">
                        {letter}
                    </li>
                );
            })}
        </ul>
    );
}

export default WordByLetter;
